import React, { useState } from "react";
import { AppBar, Toolbar, Typography, Button } from "@mui/material";
import { Link, Route, BrowserRouter as Router, Switch } from "react-router-dom";
import Skill from "./Skill";
import Resume from "./Resume";
import Project from "./Project";
import Contact from "./Contact";

const Header = () => {
  const [selectedTab, setSelectedTab] = useState("projects");

  const handleTabChange = (tab) => {
    setSelectedTab(tab);
  };

  return (
    <Router>
      <AppBar position="fixed" color="transparent" elevation={0}>
        <Toolbar>
          <Typography variant="h5" component={Link} to="/" sx={{ flexGrow: 1, textDecoration: 'none', color: 'inherit' }}>
            PORTFOLIO
          </Typography>
          <Button color="inherit" onClick={() => handleTabChange("projects")} component={Link} to="/projects">
            Projects
          </Button>
          <Button color="inherit" onClick={() => handleTabChange("resume")} component={Link} to="/resume">
            Resume
          </Button>
          <Button color="inherit" onClick={() => handleTabChange("skills")} component={Link} to="/skills">
            Skills
          </Button>
          <Button color="inherit" onClick={() => handleTabChange("contact")} component={Link} to="/contact">
            Contact
          </Button>
        </Toolbar>
      </AppBar>

      <Switch>
        <Route path="/projects" component={Project} />
        <Route path="/resume" component={Resume} />
        <Route path="/skills" component={Skill} />
        <Route path="/contact" component={Contact} />
      </Switch>
    </Router>
  );
};

export default Header;
